import request from '@/utils/request.js'

export function getTagList(){
	return request({
		url:'/tag/list',
		method:'get'
	})
}

export function save(tag){
	return request({
		url:'/tag/save',
		method:'post',
		data:tag
	})
}

export function deleteTag(tagId){
	return request({
		url:'/tag/delete',
		method:'delete'
	})
}
